import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import java.nio.charset.StandardCharsets

flowFile = session.get()
if (!flowFile) return

try {
    // Read incoming JSON from ReplaceText output
    def jsonText = new String(session.read(flowFile).bytes, StandardCharsets.UTF_8)
    def parser = new JsonSlurper()
    def inputJson = parser.parseText(jsonText)

    def fromTime = inputJson["datetimerange-fromTime"]
    def toTime = inputJson["datetimerange-toTime"]
    def allLocations = inputJson["location"]

    if (!(allLocations instanceof List) || allLocations.isEmpty()) {
        log.error("No valid 'location' array found in input JSON")
        session.transfer(flowFile, REL_FAILURE)
        return
    }

    // Define batch size
    def batchSize = 50
    def total = allLocations.size()
    def chunks = allLocations.collate(batchSize)

    log.info("Splitting ${total} locations into ${chunks.size()} batches of ${batchSize}")

    // Create new FlowFiles for each batch
    chunks.eachWithIndex { chunk, idx ->
        def body = [
            "datetimerange-fromTime": fromTime,
            "datetimerange-toTime": toTime,
            "location": chunk
        ]

        def jsonOut = JsonOutput.prettyPrint(JsonOutput.toJson(body))

        def newFlowFile = session.create(flowFile)
        newFlowFile = session.write(newFlowFile, { inputStream, outputStream ->
            outputStream.write(jsonOut.getBytes(StandardCharsets.UTF_8))
        } as StreamCallback)

        newFlowFile = session.putAttribute(newFlowFile, "chunk.index", (idx + 1).toString())
        newFlowFile = session.putAttribute(newFlowFile, "chunk.count", chunks.size().toString())
        newFlowFile = session.putAttribute(newFlowFile, "mime.type", "application/json")
        newFlowFile = session.putAttribute(newFlowFile, "location.count", chunk.size().toString())

        session.transfer(newFlowFile, REL_SUCCESS)
    }

    // Remove the original (unsplit) flowfile
    session.remove(flowFile)

} catch (Exception e) {
    log.error("Error splitting JSON: " + e.message, e)
    session.transfer(flowFile, REL_FAILURE)
}

import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import java.nio.charset.StandardCharsets
import java.time.ZonedDateTime
import java.time.format.DateTimeFormatter
import java.util.Date

class TransformCallback implements StreamCallback {
    def fromTime
    def toTime
    def hasData = true

    TransformCallback(fromTime, toTime) {
        this.fromTime = fromTime
        this.toTime = toTime
    }

    @Override
    void process(InputStream inputStream, OutputStream outputStream) throws IOException {
        def parser = new JsonSlurper()
        def parsed = parser.parse(inputStream)

        if (!parsed || (parsed instanceof List && parsed.isEmpty())) {
            hasData = false
            return
        }

        def records = (parsed instanceof List) ? parsed : [parsed]
        def transformed = []

        records.each { rec ->

            def cab = (rec.cab instanceof List && rec.cab) ? rec.cab[0] : [:]

            // --- FIX: LOOP THROUGH ALL entry_exit ELEMENTS ---
            def entryExitList = (rec.entry_exit instanceof List) ? rec.entry_exit : []

            entryExitList.each { entryExit ->

                def direction = entryExit.direction ?: "unknown"
                def timestamp = entryExit.timestamp

                def newRec = [:]
                newRec["_id"] = rec._id
                newRec["direction"] = direction
                newRec["locationId"] = entryExit.locationId
                newRec["objectType"] = entryExit.objectType
                newRec["licensePlateNo"] = rec._id

                // cab details
                newRec["cab_type"] = cab.cab_type
                newRec["service_provider"] = cab.service_provider
                newRec["cab_sno"] = cab.sno
                newRec["cab_status"] = cab.status
                newRec["cab_updated_date"] = cab.updated_date

                // flowfile attributes
                newRec["start_time"] = fromTime
                newRec["end_time"] = toTime

                // entry/exit timestamps
                if (direction == "entry" && timestamp) {
                    newRec["entry_time"] = timestamp
                } else if (direction == "exit" && timestamp) {
                    newRec["exit_time"] = timestamp
                }

                transformed << newRec
            }
        }

        if (transformed.isEmpty()) {
            hasData = false
            return
        }

        def jsonOut = JsonOutput.prettyPrint(JsonOutput.toJson(transformed))
        outputStream.write(jsonOut.getBytes(StandardCharsets.UTF_8))
    }
}

