		// def now = ZonedDateTime.now(ZoneId.of("Asia/Kolkata")).format(DateTimeFormatter.ofPattern("yyyy-MM-dd HH:mm:ss"))

        records.collect { rec ->
            def entryExit = (rec.entry_exit instanceof List && rec.entry_exit) ? rec.entry_exit[0] : [:]
            def direction = entryExit.direction ?: "unknown"
            def timestamp = entryExit.timestamp
            def newRec = [:]

