            newRec["locationId"] = entryExit.locationId
            newRec["locationType"] = entryExit.locationType
            newRec["direction"] = direction
            newRec["lpCountry"] = entryExit.lpCountry

            // Add cab/provider details
            def provider = rec.provider
            newRec["cab_type"] = provider
            newRec["service_provider"] = provider

            // Add timestamp field based on direction
            if (direction == "entry" && timestamp) {
                newRec["entry_time"] = timestamp
            } else if (direction == "exit" && timestamp) {
                newRec["exit_time"] = timestamp
            }

            // Add audit timestamps
