            // Add start_time and end_time from FlowFile attributes

            newRec["start_time"] = fromTime
            newRec["end_time"] = toTime

            // Add available field
            // newRec["available"] = null

            // Remove nulls
            // return newRec.findAll { k, v -> v != null }

			transformed << newRec
        }

        // If no valid records
        if (transformed.isEmpty()) {
            hasData = false
            return
        }

        // Output as pretty JSON
        def jsonOut = JsonOutput.prettyPrint(JsonOutput.toJson(transformed))
        outputStream.write(jsonOut.getBytes(StandardCharsets.UTF_8))
    }
}

